      "type": "string",
      "format": "email"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100
    },
    "hobbies": {
      "type": "array",
      "items": {
        "$ref": "#/definitions/hobby"
      }
    },
    "created_at": {
      "type": "string",
      "format": "date-time"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time"
    },
    "deleted_at": {
      "oneOf": [
        { "type": "null" },
        {
          "type": "string",
          "format": "date-time"
        }
